During this lockdown I decided to do something I don’t normally get time to do. Family riding days! They have been the best part of every week. I am so happy to share my love of riding with the kids. I can see the same happiness in all of their faces. The excitement packing up the gear and bikes and heading to track. Always in their gear before we even leave the house. Sometimes they listen to instructions and trust that I might know something about riding and other times I’m the Dad that knows nothing. 
They are proud of what they learn  and having too much fun so they never want to go home. My passion for dirt bikes isn’t just racing but most importantly just how fun going riding is. I’m thankful for what it has done for me in my life and i don’t have all the words to describe what it feels like to share that with your kids. #familyridedays 
